import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor(){
    super();

    this.state = {
      monsters: [
        {
          name: 'Linda',
          id: 'dzbfjk'
        },
        {
          name: 'Frank',
          id: 'dzbfjkddf'
        },
        {
          name: 'jacky',
          id: 'dzbfjk255'
        },
        {
          name: 'Andrei',
          id: 'dzb212dvd'
        },
        {
          name: 'don',
          id: 'dzbfjkdb21'
        },
      ],
    };
  }

  render(){

    return (
      <div className="App">
        {this.state.monsters.map((monster) => {
          return<h1 key={monster.id}>{monster.name}</h1>;
        })}
      </div>
    );

  }

}

export default App;
